import React from 'react';
import { useNavigate } from 'react-router-dom';

function Button(props) {
  return(
    <button onClick={props.onClick}>{props.value}</button>
  )
}
function Home() {
  const navigate = useNavigate();

  // 로그인 화면으로 이동하는 함수
  const goToLogin = () => {
    navigate('/login');
  };

  const goToLearning = () => {
    navigate('/Learning')
  }

  return (
    <div>
      <h2>홈 화면</h2>
      <button onClick={goToLogin}>로그인 화면으로 이동</button>
    </div>
  );
}

export default Home;
